import React from 'react';
import UserList from './Components/User/UserList';

function App() {
  let testUsers = [
    {userName: 'bob', key: Math.random().toString()},
    {userName: 'frank', key: Math.random().toString()},
    {userName: 'Joe', key: Math.random().toString()}
];
  return (
    <UserList users={testUsers}></UserList>
  );
}

export default App;
